// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.4.16 < 0.9.0;

import "./CZH.sol";
import "./LFJ.sol";

contract EthSwap {
    string public name = "Eth swap platform contract";
    CZH public tokenCZH;
    LFJ public tokenLFJ;
    uint public czhRate = 100; // 100 CZH = 1 ETH
    uint public lfjRate = 10; // 10 LFJ = 1 ETH
    uint public czhTokenBalance;
    uint public lfjTokenBalance;

    event TokensPurchased(
        address account,
        address token,
        uint amount,
        uint czhRate
    );

    event TokensSold(
        address account,
        address token,
        uint amount,
        uint czhRate
    );

    constructor(CZH _token1, LFJ _token2) {
        tokenCZH = _token1;
        tokenLFJ = _token2;
        czhTokenBalance = tokenCZH.balanceOf(address(this));
        lfjTokenBalance = tokenLFJ.balanceOf(address(this));
    }

    function swapTokens(address _tokenToBuy, address _tokenToSell, uint _valueToSell) public payable {
        // 1 меняю ЧИЖ на ЛФЖ
        // Я юзер хочу купить 1CZH за 100LFJ у меня они есть
        // контракт должен проверить что у меня есть 100LFJ
        // что 100LFJ = 1CZH
        // и что на бирже есть 1CZH

        // 2 проверяю балансОф у msg.sender токена который он продает чтобы он был равен _tokenToSell * conversionRate
        CZH token2 = CZH(_tokenToSell);
        require(token2.balanceOf(address(msg.sender)) >= _valueToSell, "Not enough CZH available to buy");

        // 3 проверить баланс контракта который он покупает - есть ли он на свапалке

        // 4 делаю трансфер у токен ЧиЖ и у токен LFJ

        // 5 делаем transferFrom где addressFrom контракт свапалки


    }

    function buyTokens() public payable {
        // Calculate the number of tokens to buy
        uint tokenAmount = msg.value * czhRate;

        // Require that EthSwap has enough tokens
        require(tokenCZH.balanceOf(address(this)) >= tokenAmount, "Not enough CZH available to buy");

        // Transfer tokens to the user
        tokenCZH.transfer(msg.sender, tokenAmount);

        // Emit an event
        emit TokensPurchased(msg.sender, address(tokenCZH), tokenAmount, czhRate);
    }

    function sellTokens(uint _amount) public payable {
        // User can't sell more tokens than they have
        require(tokenCZH.balanceOf(msg.sender) >= _amount, "You can not sell more tokens than you currently hold");

        // Calculate the amount of Ether to redeem
        uint etherAmount = _amount / czhRate;

        // Require that EthSwap has enough Ether
        require(address(this).balance >= etherAmount, "Swap contract does not have enough available ETH amount");

        // Perform sale
        tokenCZH.transferFrom(msg.sender, address(this), _amount);
        payable(msg.sender).transfer(etherAmount);

        // Emit an event
        emit TokensSold(msg.sender, address(tokenCZH), _amount, czhRate);
    }

}

